cy.visit(Cypress.env('quipper_plans'));
cy.url().should('include', '/plans'); //Test the `Payment Method Page` Integration with Pricing 
cy.get('[id="1808"]').within(function () {
  //Get the Pricing Plan Title from Select a Plan Page
  cy.get('.PricingPlan__title').then(function ($title) {
    var txt = $title.text();
    cy.wrap(txt).as('planName');
  }); //Get the Price from Select a Plan page
  cy.get('.PricingPlan__price').then(function ($price) {
    var prc = $price.text();
    cy.wrap(prc).as('planPrice');
  });
  cy.contains('Subscribe').click();
});
cy.url().should('include', '/payment/methods'); //Get the Pricing Plan Title from Payment Method Page
cy.get('.SubscriptionPlanName').then(function ($judul) {
  var text = $judul.text();
  cy.wrap(text).as('planNamePayment');
}); //Get the Pricing Plan Price from Payment Method Page
cy.get('.Amount__final').then(function ($harga) {
  var hrg = $harga.text();
  cy.wrap(hrg).as('planPricePayment');
}); //Validate on Pricing Plan Title Data
cy.get('@planName').then(function (planName) {
  cy.get('@planNamePayment').then(function (planNamePayment) {
    expect(planName).to.equal(planNamePayment);
  });
}); //Validate on Pricing Plan Price Data
cy.get('@planPrice').then(function (planPrice) {
  cy.get('@planPricePayment').then(function (planPricePayment) {
    expect(planPrice).to.equal(planPricePayment);
  });
});

